  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ottawa
  National Wildlife Refuge, Cedar Point National Wildlife Refuge, West Sister Island
  National Wildlife Refuge, Navarre Unit, and Darby Unit outlines Refuge accomplishments
  during the 1975 fiscal year. The report begins by summarizing the weather conditions,
  habitat conditions, and water conditions during the year. The Construction and Maintenance
  section discusses physical developments, plantings, and safety improvements. The
  Habitat Management section, including Wetland Management and Cropland Management,
  follows. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, mammals, and raptors- is also covered. Resource Management
  is outlined; topics include fur harvesting. The Interpretation and Recreation section
  of the report describes recreational uses, refuge visitors, refuge participation,
  hunting, violations, and safety.A progress report on field investigations and applied
  research is also provided. Cedar Point and West Island National Wildlife Refuge
  reports follow. The report emphasizes developments toward the Ottawa YCC Camp.\",\n\t\"license_title\":
